import React from 'react';
import { fnlPlayers } from '../Utils';

const Players = () => {
    return (
        <div style={{ margin: '20px' }}>
            <h1>FNL Players</h1>
            <div style={{ display: 'flex', flexWrap: 'wrap' }}>
                {fnlPlayers.map((player, index) => (
                    <div
                        key={index}
                        style={{
                            border: '1px solid black',
                            borderRadius: '5px',
                            margin: '10px',
                            padding: '10px',
                            width: '200px',
                            boxShadow: '0px 2px 4px rgba(0, 0, 0, 0.25)',
                            backgroundColor: '#fff',
                        }}
                    >
                        <img src={player.imageUrl} alt={player.name} style={{ width: '100%' }} />
                        <h3>{player.name}</h3>
                        <p>Age: {player.age}</p>
                        <p>Shoot Hand: {player.shootHand}</p>
                    </div>
                ))}
            </div>
        </div>
    );
};

export default Players;
